import React from 'react';
import { Card, CardContent, Typography } from '@mui/material';
import ListProjects from './components/list-projects';
import { Box } from '@mui/system';
const Projects = () => {
    const projects = [
        {
            title: 'Application Todo List avec React et GraphQL',
            description: 'Description de votre projet ici',
            images: ["../../../assets/project1/p1.png", "../../../assets/project1/p2.png", "../../../assets/project1/p3.png", "../../../assets/project1/p4.png"],
            video: 'https://www.youtube.com/embed/tkCRqmgGa4Q',
            githubLink: 'https://github.com/https://github.com/VendenIX/Todolist-react-native/projet1'
        },
    ];

    return(
    <Box>
        <ListProjects projects={projects} />;
        <img src={"/home/romain/Documents/P_R_O_J_E_T_S/portfolio/assets/project1/p3.png"} alt="RADABAhfggggggggggggggggg" style={{ width: "100%", height: "auto" }} />
    </Box>
    );
};

export default Projects;
